script: |
  super -f text -I q951.spq | sort > q951.out

inputs:
  - name: q951.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE NOT + col2 BETWEEN col2 * 45 / + 29 AND + col0 * + col1 + 57 OR NOT col0 * 98 + + col1 IS NULL;
  - name: tab2

outputs:
  - name: q951.out
    data: |
      46	51	23
      64	77	40
      75	67	58
